import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './Login';
import './Home.css'
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import {
  AppBar,
  Toolbar,
  IconButton,
  TextField,
} from '@mui/material';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { ShoppingCart, Home as HomeIcon } from '@mui/icons-material';
import DashboardIcon from '@mui/icons-material/Dashboard';
const cards = [
  {
    id: 1,
    heading: 'Vegetables',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 2,
    heading: 'Fruits',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Grocery',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Baked Items',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Beverages',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Snacks Store',
    image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR_lDRlrdZzLGSaCRJ8RhDxZav46OkowNqDzQ&usqp=CAU',
  },
   {
    id: 3,
    heading: 'Cleaning & Household',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Beauty & Hygiene',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    heading: 'Home & Kitchen',
    image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRW-8hZ3LJ51OysGPZuxPKnb4bCd2NbxziK_Q&usqp=CAU',
  },
];

const defaultTheme = createTheme();
const Home = () => {
  return (
    <div className='sem'>
      <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
        <AppBar position="static" style={{backgroundColor:'black'}}>
          <Toolbar>
          <Link to="/dashboard" style={{ textDecoration: 'none', color: 'inherit' }}>
          <IconButton color="inherit">
            <DashboardIcon />
          </IconButton>
        </Link>
            <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
              <IconButton color="inherit">
                <HomeIcon />
              </IconButton>
            </Link>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              <b>SUPER MARKET MANAGEMENT</b>
            </Typography>
            <Link to="/cart" style={{ textDecoration: 'none', color: 'inherit' }}>
          <IconButton color="inherit">
            <ShoppingCartIcon />
          </IconButton>
        </Link>
        
            <TextField
              placeholder="Search..."
              variant="outlined"
              size="small"
              sx={{
                backgroundColor: 'rgba(200, 200, 200, 0.3)',
                '& input': {
                  color: 'inherit',
                },
                '& input::placeholder': {
                  color: 'inherit',
                },
                mr: 2,
              }}
            />
            <Link to="/login" style={{ textDecoration: 'none' }}>
              <Button color="inherit" sx={{ color: 'white' }}>
                Login
              </Button>
            </Link>
          </Toolbar>
        </AppBar>

        <ThemeProvider theme={defaultTheme}>
      <CssBaseline />
      <main>
        {/* Hero unit */}
        <Box
          sx={{
            bgcolor: 'background.paper',
            pt: 8,
            pb: 20,
          }}
        >
         
        </Box>
        <Container sx={{ py: 8 }} maxWidth="md">
          {/* End hero unit */}
          <Grid container spacing={4}>
  {cards.map((card) => (
    <Grid item key={card.id} xs={12} sm={6} md={4}>
      <Card
        sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
      >
        <CardMedia
          component="div"
          sx={{
            // 16:9
            pt: '56.25%',
          }}
          image={card.image}
        />
        <CardContent sx={{ flexGrow: 1 }}>
          <Typography gutterBottom variant="h5" component="h2">
            {card.heading}
          </Typography>
        </CardContent>
        <CardActions>
          <Button size="small">Buy</Button>
          <Button size="small">Add to Cart</Button>
        </CardActions>
      </Card>
    </Grid>
  ))}
</Grid>

        </Container>
      </main>
    </ThemeProvider>
        
        <Container style={{ flexGrow: 1 }}>
          <Routes>
            <Route path="/login" element={<Login />} />
          </Routes>
        </Container>     
        <AppBar position="static" style={{backgroundColor:'black'}}>
          <Toolbar>
            <Container>
              <Typography variant="body1" color="inherit" sx={{ flexGrow: 1 }}>
                 All rights reserved.
              </Typography>
              <Typography variant="body1" color="inherit">
                Contact Us | Privacy Policy | Terms of Service
              </Typography>
            </Container>
          </Toolbar>
        </AppBar>
      </div>
    </div>
  );
};

const Dashboard = () => {
  return (
    <div>
      <Typography variant="h4">Dashboard</Typography>
      {/* Add other necessary components for the dashboard */}
    </div>
  );
};

export default Home;